import React, {useEffect} from 'react';
import $ from "jquery";
import * as Axios from "../../utils/Axios";

const submitForm = (e) => {
    e.preventDefault()
    if ($('#email')[0].value === "" || $('#password')[0].value === "") {
        console.log('Invalid')
        return
    }
    const post = Axios.AxiosPost('/login', {
        email: $("#email")[0].value,
        password: $("#password")[0].value
    })
    console.log(post)
}

const Button = (props) => {
    useEffect(() => {
        const keyDownHandler = event => {
            if (event.key === 'Enter') {
                submitForm(event);
            }
        };

        document.addEventListener('keydown', keyDownHandler);

        return () => {
            document.removeEventListener('keydown', keyDownHandler);
        };
    }, []);
    return (
        <button type="submit" className="btn btn-primary" onClick={e => submitForm(e)}>{props.name}</button>
    );
};

export default Button;
